import './Expenses.css'
import ExpenseItem from './components/expenseItem/ExpenseItem'
function Expenses(props) {
    return (
        <div className="expenses">
            <ExpenseItem expenseDate={expenses.expenses[0].date} expenseAmount={expenses.expenses[0].amount} expenseTitle={expenses.expenses[0].title} />
            <ExpenseItem expenseDate={expenses.expenses[1].date} expenseAmount={expenses.expenses[1].amount} expenseTitle={expenses.expenses[1].title} />
            <ExpenseItem expenseDate={expenses.expenses[2].date} expenseAmount={expenses.expenses[2].amount} expenseTitle={expenses.expenses[2].title} />
        </div>
    )
}

export default Expenses
